import { useAuth0 } from "@auth0/auth0-react";

const LoginAuth = () => {
  console.log(process.env.REACT_APP_AUTH0_DOMAIN);
  const { loginWithRedirect } = useAuth0();
  return (
    <button
      onClick={() => {
        loginWithRedirect();
      }}
    >
      LoginAuth
    </button>
  );
};

export default LoginAuth;
